def _convert_timestamp_from_grass(ts):
    """Convert a GRASS file based timestamp into the temporal framework
    format datetime or integer.

    A tuple of two datetime objects (start, end) is returned in case of
    absolute time.
    In case of relative time a tuple with start time, end time and the
    relative unit (start, end, unit) will be returned.

    Note:
    The end time will be set to None in case of a time instance.

    :param ts grass.lib.gis.TimeStamp object created by G_read_*_timestamp
    """

    dt1 = libgis.DateTime()
    dt2 = libgis.DateTime()
    count = c_int()

    libgis.G_get_timestamps(byref(ts), byref(dt1), byref(dt2), byref(count))

    if dt1.mode == libdate.DATETIME_ABSOLUTE:
        pdt1 = None
        pdt2 = None
        if count.value >= 1:
            pdt1 = datetime(
                int(dt1.year),
                int(dt1.month),
                int(dt1.day),
                int(dt1.hour),
                int(dt1.minute),
                int(dt1.second),
            )
        if count.value == 2:
            pdt2 = datetime(
                int(dt2.year),
                int(dt2.month),
                int(dt2.day),
                int(dt2.hour),
                int(dt2.minute),
                int(dt2.second),
            )

        # ATTENTION: We ignore the time zone
        # TODO: Write time zone support
        return (pdt1, pdt2)
    unit = None
    start = None
    end = None
    if count.value >= 1:
        if dt1.year > 0:
            unit = "years"
            start = dt1.year
        elif dt1.month > 0:
            unit = "months"
            start = dt1.month
        elif dt1.day > 0:
            unit = "days"
            start = dt1.day
        elif dt1.hour > 0:
            unit = "hours"
            start = dt1.hour
        elif dt1.minute > 0:
            unit = "minutes"
            start = dt1.minute
        elif dt1.second > 0:
            unit = "seconds"
            start = dt1.second
    if count.value == 2:
        if dt2.year > 0:
            end = dt2.year
        elif dt2.month > 0:
            end = dt2.month
        elif dt2.day > 0:
            end = dt2.day
        elif dt2.hour > 0:
            end = dt2.hour
        elif dt2.minute > 0:
            end = dt2.minute
        elif dt2.second > 0:
            end = dt2.second
    return (start, end, unit)


