        self.client_conn.send(
            [
                RPCDefs.WRITE_TIMESTAMP,
                RPCDefs.TYPE_VECTOR,
                name,
                mapset,
                layer,
                timestring,
            ]
        )
        return self.safe_receive("write_vector_timestamp")

